import React , {useState, useEffect}from 'react'

function ShowGroup(props) {
    const [groupName, setGroupName] = useState(undefined)

    useEffect(() => {
        setGroupName( props.name )   
    })
    return (
        <div>
            <h1>{props.name}</h1>
        </div>
    )
}

export default ShowGroup
